INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 2, "2030/01/01 14:59:59", 3001, 2.1, 3001100, -416.5, "2024/10/31 12:00:00", 130011, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 2, "2030/01/01 14:59:59", 3001, 5.68, 3001101, -416.5, "2024/10/31 12:00:00", 130011, 0.0, 4);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 1, "2030/01/01 14:59:59", 3001, 0.0, 3001102, -416.5, "2024/10/31 12:00:00", 130011, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 1, "2030/01/01 14:59:59", 3002, 0.0, 3002100, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 1, "2030/01/01 14:59:59", 3002, 0.0, 3002101, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 2, "2030/01/01 14:59:59", 3002, 8.53, 3002102, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 5);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 1, "2030/01/01 14:59:59", 3002, 5.67, 3002103, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 1, "2030/01/01 14:59:59", 3002, 0.0, 3002104, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 3, "2030/01/01 14:59:59", 3004, 0.0, 3002300, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 3);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 7, "2030/01/01 14:59:59", 3005, 0.0, 3002400, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 1, "2030/01/01 14:59:59", 3003, 4.4, 3003200, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 7, "2030/01/01 14:59:59", 3003, 0.0, 3003201, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 2, "2030/01/01 14:59:59", 3003, 5.6, 3003202, -416.5, "2024/10/31 12:00:00", 130211, 0.0, 1);
